	(15, '"The Camera in Your Pocket"  Mobile Photography Deep Dive', 'The cameras in our phones can be great tools. Some people in the group have already been making use of it - we''ve even met some phone-only photographers! However some people might not be getting the most out of their phone cameras. Let''s explore together!', '2025-11-22', '13:00:00', 'The Tea Lab
