	(2, 'Wandering around Haagse Bos', 'For our November meetup we wanted to embrace the word of the month: Wandering. We''ll meet at Caff Almondo initially to socialize, catch-up, and have a drink. In the first part of the meetup we''ll hang out and chat. Afterwards, we''ll head out for a photo walk around the neighborhood.', '2024-11-30', '13:00:00', 'Caff Almondo
