	(10, 'Robert''s Experiences at Kodak', 'At this meetup, Robert will be giving a talk about his time at Kodak. After graduating from university, he began his career there and eventually joined the Government Systems Division. Join us for fascinating insights into the world of film photography.', '2025-06-28', '13:00:00', 'The Tea Lab
