	(6, 'Photo Share & Walk around Het Park', 'For March we want to have an open "photo share" day. Pick out one photo (or a small series) that you''d like to share with the group! You can ask for feedback, share the story behind it, or simply show off your work.', '2025-03-29', '13:00:00', 'The Tea Lab
Nieuwe Binnenweg 178 A
