	(7, 'Nature/Wildlife Photography & Walk around Kralingse Bos', 'Spring is here and we want to take full advantage of the nice weather! We''ll gather at restaurant De Tuin in Kralingse Bos and Murtada will give a short photography talk. Afterwards, we''ll explore the park together for a photo walk.', '2025-04-19', '13:00:00', 'Restaurant de Tuin
