	(8, 'Mini Meetup: Kralingse Bos', 'Let''s explore more of Kralingse Bos together! We''ll be starting the walk from De Ster (the windmill) and we''ll be doing a counter clockwise circle through the park. Very relaxed pace, perfect for photography.', '2025-05-10', '13:00:00', 'Plaszoom at The windmill (De ster)
