	(12, 'Spec it, Shoot it, Share it!', 'This meetup is all about creativity, teamwork, and real-world practice. Inspired by spec campaign projects, we''ll work together to create compelling photography for a fictional brand or cause. Great opportunity to build your portfolio!', '2025-08-16', '13:00:00', 'The Tea Lab
