	(13, 'Photoshare: Summer Recap!', 'Summer is coming to an end. Many of you have been traveling and exploring (locally and abroad) or just going out to take photos more often during the nice weather, so we thought it would be great to have a meetup to share our summer photography!', '2025-09-27', '13:00:00', 'The Tea Lab
