	(14, 'Surreal Photography', 'Let''s explore October''s photo challenge prompt together! Often some people express trying to capture moments perfectly - either as they looked in real life or an idealized version. This month we embrace imperfection and see where it takes us creatively.', '2025-10-25', '13:00:00', 'The Tea Lab
Nieuwe Binnenweg 178 A
