	(16, '2025 Recap', 'For this meetup, we''d like to share a little recap and some highlights from 2025. We will collect some photos from the past photo challenges and meetups to share how everyone has grown and what we''ve accomplished together as a community.', '2025-12-27', '13:00:00', 'The Tea Lab
