	(1, 'Contours, Compositions and Cropping', 'Let''s kick off the new year with inspiration and creativity at our first meetup of 2025! Join us as Murtada hosts and delivers an engaging short talk on "Contours, Composition, and Creative Framing" to inspire your photography journey this year.', '2025-01-25', '13:00:00', 'The Tea Lab
