	(17, 'Introductory Meetup', 'For our first get together we''d like to have an introductory meetup! After an inspiring speech from Murtada, you''re welcome to hang out, get to know each other, share your work, and connect with fellow photography enthusiasts.', '2024-10-12', '13:00:00', 'The Tea Lab
