	(18, 'Coffee, Chat, and a Walk around Het Park', 'For our monthly meetup, we''re going to start at The Tea Lab in Rotterdam to catch up, have some drinks, and chat for a bit. We''d love to hear back from anyone who attended the previous meetups.', '2024-12-14', '13:00:00', 'The Tea Lab
