	(20, 'Nederlands Fotomuseum - Group visit', 'We''re planning a group visit to the Dutch Photo Museum (Nederlands Fotomuseum) in Rotterdam. This museum is the national museum for photography in the Netherlands and is known for its rich collection of both historical and contemporary work. With millions of images in its archive, it shows how photography has shaped the way we look at the world.

This visit is extra special because the museum is reopening in its stunning new home in the Santos warehouse on Rotterdams Rijnhaven on 7 February 2026. The renovated landmark building will offer a fresh way to experience photography, with exhibitions, studios, a photo book library, a darkroom, and social spaces for everyone to enjoy.

We''ll go together as a group but you''re free to explore separately! It will be a great chance for us to explore inspiring work together, talk about what we see, and simply enjoy a shared photography experience in person. Let''s make an afternoon of it!

PS. Make sure to buy your ticket beforehand!', '2026-02-14', '13:00:00', 'Pakhuis Santos (Nederlands Fotomuseum)
Brede Hilledijk 95
Rotterdam', 'https://db.creativephotography.group/storage/v1/object/public/event-covers/events/b81b1a94-5c38-49c4-9ac4-5b462b412c82.png', 0, '2026-01-12 14:02:36.205923+00', NULL, NULL, NULL, NULL, NULL, 'nederlands-fotomuseum-group-visit', NULL, NULL),
	(19, 'Photos, Pixels, People: Sharing photography online', 'Photography doesn''t stop after taking the photo. In this session, we''ll talk about how we share our work online and how we connect with other photographers. We''ll open the floor to hear about everyone''s workflow, the platforms you use, and how you like to share your photography. You''re welcome to prepare something for this and present your portfolio and your online presence. We''ll also brainstorm about what we could do as a group to make sharing more fun and more visible.

Oh, and last but not least: we''ll also present our brand new website, built around sharing and showcasing your photography!', '2026-01-31', '13:00:00', 'The Tea Lab
